import React from "react";
import "./style.css";
import Uploader from "./Uploader";
import DisplayImage from "./DisplayImage";

const App = () => {
  return (
    <div className='App'>
      <Uploader />
      <hr />
      <DisplayImage />
    </div>
  );
};

export default App;
